import { Grid, Paper } from "@material-ui/core";

const about = ()=>{
    return(<div>

        <Grid container justify='center' >
        <Grid container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6}>
          <Paper >Hello</Paper>
        </Grid>
        <Grid  container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6}>
          <Paper >World</Paper>
        </Grid>
        </Grid>
        <style jsx>{`
        .hello {
          font: 15px Helvetica, Arial, sans-serif;
          background: #eee;
          padding: 100px;
          text-align: center;
          transition: 100ms ease-in background;
        }
        .hello:hover {
          background: #ccc;
        }
      `}</style>
    </div>)
}

export default about;
